UE[df_filtered$VARIANT_NAME == \"control\"]\nvariant_revenue <- df_filtered$REVENUE[df_filtered$VARIANT_NAME == \"variant\"]\n\nmw_test <- wilcox.test(control_revenue, variant_revenue)\nmw_test","metadata":{"execution":{"iopub.status.busy":"2023-04-14T21:35:16.792667Z","iopub.execute_input":"2023-04-14T21:35:16.794267Z","iopub.status.idle":"2023-04-14T21:35:16.824707Z"},"trusted":true},"execution_count":18,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n\tWilcoxon rank sum test with continuity correction\n\ndata:  control_revenue and variant_revenue\nW = 4622832, p-value = 0.2444\nalternative hypothesis: true location shift is not equal to 0\n"},"metadata":{}}]},{"cell_type":"markdown","source":"What about for only paying customers?","metadata":{}},{"cell_type":"code","source":"control_revenue <- df_filtered$REVENUE[df_filtered$VARIANT_NAME == \"control\" & df_filtered$REVENUE > 0]\nvariant_revenue <- df_filtered$REVENUE[df_filtered$VARIANT_NAME == \"variant\" & df_filtered$REVENUE > 0]\n\nmw_test <- wilcox.test(control_revenue, variant_revenue)\nmw_test","metadata":{"execution":{"iopub.status.busy":"2023-04-14T21:36:00.951816Z","iopub.execute_input":"2023-04-14T21:36:00.953458Z","iopub.status.idle":"2023-04-14T21:36:00.976997Z"},"trusted":true},"execution_count":20,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n\tWilcoxon rank sum test with continuity correction\n\ndata:  control_revenue and variant_revenue\nW = 1292, p-value = 0.3432\nalternative hypothesis: true location shift is not equal to 0\n"},"metadata":{}}]},{"cell_type":"code","source":"df_filtered_paid <- df_filtered[df_filtered$REVENUE > 0, ]","metadata":{"execution":{"iopub.status.busy":"2023-04-14T22:16:07.135965Z","iopub.execute_input":"2023-04-14T22:16:07.137845Z","iopub.status.idle":"2023-04-14T22:16:07.154123Z"},"trusted":true},"execution_count":82,"outputs":[]},{"cell_type":"code","source":"","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## In general it is not good to remove outliers without reason, or without including them in another analysis. I will remove outliers here to make distribution comparison a little more clear for the figure.","metadata":{}},{"cell_type":"code","source":"Q1 <- quantile(df_filtered_paid$REVENUE, 0.25)\nQ3 <- quantile(df_filtered_paid$REVENUE, 0.75)\nIQR <- Q3 - Q1\n\ndf_filtered_paid_Noutlier <- subset(df_filtered_paid, !(REVENUE < (Q1 - 1.5 * IQR) | REVENUE > (Q3 + 1.5 * IQR)))\n\nggplot(df_filtered_paid_Noutlier, aes(x = VARIANT_NAME, y = REVENUE, fill = VARIANT_NAME)) +\n  geom_boxplot() +\n  labs(x = \"Group\", y = \"Revenue\") +\n  scale_fill_manual(values = c(\"#0072B2\", \"#E69F00\")) +\n  theme_classic()","metadata":{"execution":{"iopub.status.busy":"2023-04-14T22:00:48.637276Z","iopub.execute_input":"2023-04-14T22:00:48.639668Z","iopub.status.idle":"2023-04-14T22:00:49.216616Z"},"trusted":true},"execution_count":56,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzde5zVc/7A8c+Za810171EN1JCbOsS2lx+Nne5lCzVioq1IZfcVsk9cmlZtySE\nVtjFZhcrrTttLimEUEol3W8z08z8/hibdD2NZs706fl87GMfc77ne3nPPGYevXy/53tOori4\nOAAAsO1LS/UAAABsHcIOACASwg4AIBLCDgAgEsIOACASwg4AIBLCDgAgEsIOACASUYXd5MmT\nmzdv3rx58y+++CLVswAAlLeMVA+wNeXl5U2fPj2EkJ+fn+pZAADKW1Rn7AAAtmfCDgAgEsIO\nACASwg4AIBLCDgAgEsIOACASwg4AIBLCDgAgEsIOACASwg4AIBLCDgAgEsIOACASwg4AIBLC\nDgAgEsIOACASwg4AIBLCDgAgEsIOACASwg4AIBLCDgAgEsIOACASwg4AIBLCDgAgEsIOACAS\nwg4AIBLCDgAgEsIOACASGeV8vIf69ah0zT3d6lT+34KiV5+4+7n/TJq5NH233fft+cdeTSun\nb2i7JFcDANh+lecZu+IvXn/wmdmLVhcXr1k0/akrbxvz1v5dzrr6/DNyvnz5igvvL97Qlkmu\nRtzy8/Pnzp1bVFSU6kEAoIIqpzN2c167/cr73pi3OO9nS4vzh435pMXpw046rGkIocVN4eQe\nQx//7vTuDXJLsxrxmjZt2rBhwyZNmlRUVFSpUqVjjz22b9++1apVS/VcAFCxlNMZu1p7nDTw\n6htuuenStRfmLf7PjFWFnQ9pWPIwu+ZBe1bJem/C3HW2TXI1YvX+++/36NGjpOpCCKtWrfrr\nX//ao0eP5cuXp3o0AKhYyumMXVb1xi2qh8L8SmsvzF/+UQihdc5PM7TJyXjx48XrbLvZ1V59\n9dXJkyeHEObMmdOoUaNZs2aVwX