\n\n* Example: Revenue might not change, but time spent on website might have changed. Perhaps this was more in line with the goal than increasing sales.","metadata":{}},{"cell_type":"markdown","source":"# Ideas\n* Bootstrap to get distribution from total population\n\nThe purpose of bootstrapping is to estimate the sampling distribution of a statistic by resampling the available data with replacement. The main idea is that the original sample is considered to be a representation of the population, and that by resampling the sample many times, we can generate a distribution of statistics that would have been obtained if we had repeatedly sampled from the population. This can be useful when we want to make inferences about a population parameter, but only have a limited sample available. ","metadata":{}},{"cell_type":"code","source":"# # Define a function to get bootstrap samples\n# get_bootstrap_samples <- function(data, n_samples=1000) {\n#   indices <- matrix(sample.int(length(data), n_samples*length(data), replace=TRUE), ncol=length(data))\n#   samples <- data[indices]\n#   return(samples)\n# }\n\n# # Define a function to calculate confidence intervals\n# stat_intervals <- function(stat, alpha=0.05) {\n#   boundaries <- quantile(stat, c(alpha/2, 1-alpha/2))\n#   return(boundaries)\n# }\n\n# # Get bootstrap samples for the control and variant groups\n# control_paid <- get_bootstrap_samples(df_filtered[df_filtered$VARIANT_NAME == 'control' & df_filtered$REVENUE > 0, 'REVENUE'])\n# variant_paid <- get_bootstrap_samples(df_filtered[df_filtered$VARIANT_NAME == 'variant' & df_filtered$REVENUE > 0, 'REVENUE'])\n\n# # Create a data frame for plotting\n# plot_data <- data.frame(mean = c(mean(control_paid), mean(variant_paid)),\n#                         group = rep(c('Control', 'Variant'), each=10000),\n#                         density = rep(c('Control', 'Variant'), each=10000))\n\n# # Create a kernel density plot of the sample means\n# ggplot(plot_data, aes(x=mean, fill